import React from 'react';
import { Link } from 'react-router-dom';
import './SideMenu.css';

const SideMenu = () => {
  return (
    <div className="side-menu">
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/create-task">Create Task</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default SideMenu;
